import React from 'react'
import { Upload, Icon, Modal, Button } from 'antd'
import { theUrl } from 'selfConfig'

const props = {
  action: theUrl+'',
  listType: 'picture',
  defaultFileList: [ ],
};

class Picwall extends React.Component {
  state = {
    previewVisible: false,
    previewImage: '',
    fileList: [],
  };

  render() {

    return(
      <Upload {...props}>
      <Button>
        <Icon type="upload" /> Upload
      </Button>
      </Upload>
    )
  }
}

export default Picwall
